import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import DrawerMainTable from './DrawerMainTable';
import { useQuery, useQueryClient } from 'react-query';

type DessertDetail = {
  name: string,
  calories: number,
  fat: number,
  carbs: number,
  protein: number
}

function createData(data: DessertDetail) {
  return ({
    name: data.name,
    calories: data.calories,
    fat: data.fat,
    carbs: data.carbs,
    protein: data.protein
  })
}

const rows = [
  createData({ name:'Frozen yoghurt', calories: 159, fat: 6.0, carbs: 24, protein: 4.0 }),
  createData({ name:'Ice cream sandwich', calories: 237, fat: 9.0, carbs: 37, protein: 4.3 }),
  createData({ name:'Eclair', calories: 262, fat: 16.0, carbs: 24, protein: 6.0 }),
  createData({ name:'Cupcake', calories: 305, fat: 3.7, carbs: 67, protein: 4.3 }),
  createData({ name:'Gingerbread', calories: 356, fat: 16.0, carbs: 49, protein: 3.9 }),
];

const getPriceBTC = async () => {
  const res = await fetch('https://api.coindesk.com/v1/bpi/currentprice.json');
  return res.json();
};

// Access the client
  // Queries

  // Mutations
  // const mutation = useMutation(postTodo, {
  //   onSuccess: () => {
  //     // Invalidate and refetch
  //     queryClient.invalidateQueries('todos')
  //   },
  // })

export default function MainTable() {
  const [dataDrawer, setDataDrawer] = React.useState<DessertDetail | null>(null)
  const queryClient = useQueryClient()
  const query = useQuery('todos', getPriceBTC)

  console.log("query", query)

  return (
    <>
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell>Dessert (100g serving)</TableCell>
              <TableCell align="right">Calories</TableCell>
              <TableCell align="right">Fat&nbsp;(g)</TableCell>
              <TableCell align="right">Carbs&nbsp;(g)</TableCell>
              <TableCell align="right">Protein&nbsp;(g)</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.map((row) => (
              <TableRow 
                onClick={() => {setDataDrawer(row)}}
                key={row.name}
                className='hover:cursor-pointer'
                sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
              >
                <TableCell component="th" scope="row">
                  {row.name}
                </TableCell>
                <TableCell align="right">{row.calories}</TableCell>
                <TableCell align="right">{row.fat}</TableCell>
                <TableCell align="right">{row.carbs}</TableCell>
                <TableCell align="right">{row.protein}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
      <DrawerMainTable
        data={dataDrawer}
        setData={setDataDrawer}
      />
    </>
  );
}
